import React from 'react';
import "./Map.css";
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text }) => <div>{text}</div>;

export default function Map() {
    // const [mapCenter, setMapCenter] = React.useState({ lat: 32.88014427419814, lng: -117.2368479668978 });
    const [mapZoom, setMapZoom] = React.useState(13);

    const mapCenter = { lat: 32.88014427419814, lng: -117.2368479668978 };
    return (
        <div className="Map" style={{ height: '100vh', width: '100%' }}>
            <GoogleMapReact
                bootstrapURLKeys={{ key: "AIzaSyCnasDuC3M7MHKCLlxqXU3vyJnzKAnwBTw" }}
                defaultCenter={mapCenter}
                defaultZoom={13}
            >
                <AnyReactComponent
                    lat={32.88014427419814}
                    lng={-117.2368479668978}
                    text="Hello"
                />
            </GoogleMapReact>
        </div>
    )
}
